// jquery.preloadImages
jQuery.preloadImages = function()
{
  for(var i = 0; i<arguments.length; i++)
  {
    jQuery("<img>").attr("src", arguments[i]);
  }
}

jQuery.preloadSpinner = function ()
{
    var imgUrl = $("<div/>").addClass("spinner").css("background-image");
    if (!imgUrl) return;
    var imgMatches = imgUrl.match(/url\(\"(.*?)\"\)/);
    if (imgMatches && imgMatches.length) jQuery.preloadImages(imgMatches[1]);
}

