/*
*       Toolbox (frontpage posten.no)
*/
(function($) {
    $.extend({
        classNameFromPrefix : function(element, prefix) {
            var classAttr = element && element.attr && element.attr("class");
            var remainder = classAttr.substring(classAttr.indexOf(prefix))
            return remainder.substring(0, remainder.indexOf(" "))
        }
    });

    $.fn.postenToolBox = function(options) {                        
        var bgOff = function() {
            if ($.browser.msie && parseInt($.browser.version, 10) < 9) {
                $(".panel.png_bg").css("background-color", "transparent");
            }
        }
        var bgOn = function() {
            if ($.browser.msie && parseInt($.browser.version, 10) < 9) {
                $(".panel.png_bg").css("background-color", "white");
            }
        }
        
        var doSwitch = function(element) {            
            element.parents("div.toolBox").find(".panel." + $.classNameFromPrefix(element, "tool_")).addClass("selected").fadeIn(200, function() {
                bgOff();
            });
        }
        var clicked = function(element) {
            var previousPanel = element.parents("div.toolBox").find(".panel.selected");
                
                element.siblings(".selected").removeClass("selected");
                element.addClass("selected");
                
                if (previousPanel.length > 0) {
                    previousPanel.removeClass("selected");
                    bgOn();
                    previousPanel.fadeOut(200, function() {                        
                        doSwitch(element);
                    });
                } else {
                    doSwitch(element);
                }
        }
        var settings = { initialToolSelector : ".tool_1" };
        options && $.extend(settings, options);
        return this.each(function() {
            
            $(this).find(".panel").hide().filter(settings.initialToolSelector).show();
            clicked($(this).find("ul.toolBox " + settings.initialToolSelector));
            
            $(this).find("ul.toolBox>li").click(function(e) {
                clicked($(this));
            }).hover(function() { $(this).toggleClass("hover"); });
        });
    };
})(jQuery);

$(function() { 
    $("#our-websites ul a").trackClick({groupname : "Our websites"});
    
    $("input[type='text'].example").example(function () {
        return $(this).attr("title");
    });
});

      
$(function() {
    var HOVER_DELAY = 200;
    var DROPDOWN_TIMER_ID = 0;
    initDropdown();
    
    function initDropdown() {                
      
      //Hook up events                 
      $("#our-websites-close").click(function(e) {
        e.preventDefault();
        $("#our-websites-trigger").addClass("limbo");
        dropdownDeactivate();
      });
      
      $("#our-websites-trigger.ready").live("mouseenter", triggerOnMouseEnter);
      
      $("#our-websites-trigger").live("mouseleave", triggerOnMouseOut).addClass("ready");
      
      $("#our-websites-trigger").live("click", triggerOnClickAfterDeactivate);
    
      $("#our-websites").live("mouseleave", function() {
        dropdownDeactivate();
        $("#our-websites-trigger").addClass("ready");
      })
    }

    function dropdown() {        
      $("#our-websites").stop(true, true).slideDown(200);
    }
    function dropdownDeactivate() {          
      $("#our-websites").stop(true, true).slideUp(0);
    }
    
    //Callbacks
    function triggerOnMouseEnter() {
      if (!$(this).is(".limbo")) {
        $(this).addClass("hover").removeClass("ready");
        DROPDOWN_TIMER_ID = setTimeout(dropdown, HOVER_DELAY);
      }
    }
    function triggerOnMouseOut() {
      $(this).removeClass("hover").removeClass("limbo").addClass("ready");
      clearTimeout(DROPDOWN_TIMER_ID);
    }
    function triggerOnClickAfterDeactivate(e) {
        e.preventDefault();
        dropdown();       
    }
});